import React from 'react'
import cn from 'classnames'
import List from './List'

const PricingCard = ({
    data: {
        name,
        header,
        buttonText,
        description,
        anotherOption,
        priceWithUnit,
        points
    },
}) => {
    return (
        <div className={cn('pricingBox', header ? 'package-card active' : 'package-card')}>
            {header && <span className='package__header'>{header}</span>}
            <div>
                <div className='pricingBox__header package-header'>
                    <h4>
                        {name}
                    </h4>
                    <p>{description}</p>
                </div>
                <List items={points} />
            </div>
        </div>
    )
}

export default PricingCard
